$(function(){var serverBasic="/",trTemplate='<tr class="odd gradeX">\n                            <td>{{TID}}</td>\n                            <td>{{Name}}</td>\n                            <td>{{State}}</td>\n                            <td>{{CPU}}%</td>\n                            <td>{{TotalCPU}}%</td>\n                            <td>{{BlockedBy}}</td>\n                        </tr>',listCount=25,freshThreadList=function(t){$("#thread-list").html("");for(var e=0;e<t.length;e++)if(!t[e].error){var a=trTemplate.replace(/{{TID}}/g,t[e].TID).replace(/{{Name}}/g,t[e].Name).replace(/{{State}}/g,t[e].State).replace(/{{CPU}}/g,t[e].CPU.toFixed(2)).replace(/{{TotalCPU}}/g,t[e].TotalCPU.toFixed(2)).replace(/{{BlockedBy}}/g,t[e].BlockedBy);$("#thread-list").append(a)}},freshThreadCount=function(t){if(t.error)return!1;var e=t.ThreadCount;$("#thread-count").text(e)};setInterval(function(){$("#thread-panel").is(":visible")&&($.get(serverBasic+"/vm_thread_list/"+$("#vm-id").val()+"/"+listCount,function(data){freshThreadList(eval("("+data+")"))}),$.get(serverBasic+"/vm_thread_count/"+$("#vm-id").val(),function(data){freshThreadCount(eval("("+data+")"))}))},1e3),$(".thread-list-count").change(function(){listCount=$(this).val()})});